import React from "react";
import { FaFacebookF, FaInstagram, FaTwitter, FaLinkedinIn, FaYoutube } from "react-icons/fa";

export default function Footer() {
  return (
    <footer style={styles.footer}>
      <div style={styles.content}>
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e9/STB_Tunisie.svg/800px-STB_Tunisie.svg.png"
          alt="STB Logo"
          style={styles.logo}
        />
        <h1 style={styles.title}>STB Everywhere</h1>

        <div style={styles.socialIcons}>
          <a href="#" style={styles.icon}><FaFacebookF /></a>
          <a href="#" style={styles.icon}><FaInstagram /></a>
          <a href="#" style={styles.icon}><FaTwitter /></a>
          <a href="#" style={styles.icon}><FaLinkedinIn /></a>
          <a href="#" style={styles.icon}><FaYoutube /></a>
        </div>
      </div>
    </footer>
  );
}

// CSS en JS
const styles = {
  footer: {
    backgroundColor: "#002147",
    padding: "3rem 0",
    textAlign: "center",
    color: "white",
    marginTop: "4rem"
  },
  content: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center"
  },
  logo: {
    width: "60px",
    height: "auto",
    marginBottom: "0.8rem"
  },
  title: {
    fontSize: "1.5rem",
    fontWeight: "bold",
    marginBottom: "2rem"
  },
  socialIcons: {
    display: "flex",
    gap: "1rem"
  },
  icon: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#0d3059",
    color: "white",
    borderRadius: "8px",
    padding: "0.6rem",
    fontSize: "1.2rem",
    textDecoration: "none",
    transition: "background-color 0.3s ease",
  }
};
